import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import ProfileTabs from "../components/profileComponents/ProfileTabs";
import { listMyTransactions } from "../Redux/Actions/TransactionAction";
import { getUserDetails } from "../Redux/Actions/UserAction";
//import { moment } from "moment";
import { Link } from "react-router-dom";
import "../Styles/pages/profile.scss";
import TransactionList from "../components/profileComponents/TransactionList";
import Transactions from "../components/profileComponents/Transactions";
import HomeTabs from "../components/profileComponents/HomeTabs";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faHouse,
  faCoins,
  faWallet,
  faMoneyBillTransfer,
  faMemory,
  faGear,
} from "@fortawesome/free-solid-svg-icons";

const ProfileScreen = () => {
  window.scrollTo(0, 0);

  const dispatch = useDispatch();
  const userLogin = useSelector((state) => state.userLogin);
  const { userInfo } = userLogin;
  const transactionListMy = useSelector((state) => state.transactionListMy);
  const { loading, error, transactions } = transactionListMy;

  useEffect(() => {
    dispatch(listMyTransactions());
    dispatch(getUserDetails("profile"));
  }, [dispatch]);

  return (
    <>
      <div className="cont">
        <div className="sidenav">
          <div className="logo-card pb-md-3">
            <img src="./img/logo.png" alt="logo" />
          </div>
          <div className="author-card">
            <img src="./../../img/user-1.jpg" alt="userprofileimage" />
            <p className="login-name-tag">
              <span>Welcome,</span>
              <br />
              {userInfo.name}
            </p>

            <div className="login-settings">
              <Link to={`/profile/profileTabs`}>
                <FontAwesomeIcon icon={faGear}></FontAwesomeIcon>
              </Link>
            </div>
          </div>
          <div className="wizard pt-3">
            <ul className="navigation">
              <div className="costomScrollbar">
                <div className="nav align-items-start flex-column col-12">
                  <li className="nav-link">
                    <Link to={`profile/homeTabs`}>
                      <div className="circle">
                        <FontAwesomeIcon
                          className="icon house"
                          icon={faHouse}
                        ></FontAwesomeIcon>
                      </div>
                      <p>Home</p>
                    </Link>
                  </li>
                  <li className="nav-link">
                    <Link to={`/profile/transactionList`}>
                      <div className="circle">
                        <FontAwesomeIcon
                          className="icon coins"
                          icon={faCoins}
                        ></FontAwesomeIcon>
                      </div>
                      <p>Transaction List</p>
                    </Link>
                  </li>
                  <li className="nav-link">
                    <Link to={`/profile/paying`}>
                      <div className="circle">
                        <FontAwesomeIcon
                          className="icon wallet"
                          icon={faWallet}
                        ></FontAwesomeIcon>
                      </div>
                      <p>Paying</p>
                    </Link>
                  </li>
                  <li className="nav-link">
                    <div className="circle">
                      <FontAwesomeIcon
                        className="icon mony"
                        icon={faMoneyBillTransfer}
                      ></FontAwesomeIcon>
                    </div>
                    <p>Internal Transfers</p>
                  </li>
                  <li className="nav-link">
                    <div className="circle">
                      <FontAwesomeIcon
                        className="icon memory"
                        icon={faMemory}
                      ></FontAwesomeIcon>
                    </div>
                    <p>Online Requests</p>
                  </li>
                </div>
                <div className="scrollbar">
                  <div className="dragger-container">
                    <div className="dragger-vertical">
                      <div className="dragger-bar"></div>
                    </div>
                  </div>
                </div>
              </div>
            </ul>
          </div>
        </div>
      </div>
    </>
  );
};

export default ProfileScreen;
